    <>
      <Header />
      <div className={styles.signupSection}>
        <div style={{backgroundColor: 'tomato', 
        width: '100%', height:'100px'}}>
          <h>회원가입</h>
        </div>
        <div>
          
        </div>
      </div>
    </>
  );
}
export default Main;
